import React from 'react'
import { func } from 'prop-types'

function User () {
  return (
    <div>User </div>
  )
}

function Guest () {
  return (
    <div>Guest</div>
  )
}

function App (props) {
  console.log(props)
  const { val, name } = props
  console.log(val, 'name', name)
  if (val) return <User />
  return <Guest />
}

export default App
